import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'angular-app';
  name='Angular'
  imgURL = 'https://angular.io/assets/images/logos/angular/angular.png'

  getName() {
    return this.name
  }
}
